// SPDX-License-Identifier: Unlicensed

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";


contract RedeemCodeFactory is Context, ERC721, Ownable {

    mapping(bytes32 => bool) whitelist;
    
    using Counters for Counters.Counter;
    Counters.Counter private _currentId;

    uint256 private _maxSupply;
    string private __baseURI;

    constructor(string memory name, string memory symbol, uint256 maxSupply, string memory baseUri) 
    ERC721(name, symbol) {
        _maxSupply = maxSupply;
        // _currentId is initialized to 1, since starting at 0 leads to higher gas cost for the first minter
        _currentId.increment();

        __baseURI = baseUri;
    }

    // Destroy contract and reclaim leftover funds.
    function kill() public onlyOwner{
        // require(msg.sender == owner);
        selfdestruct(payable(msg.sender));
    }
 

    // 
    function recoverSigner(bytes32 message, bytes memory sig) internal pure returns (address)
    {
        uint8 v;
        bytes32 r;
        bytes32 s;
        (v, r, s) = splitSignature(sig);
        return ecrecover(message, v, r, s);
    }

    
     // Signature methods
    function splitSignature(bytes memory sig) internal pure returns (uint8, bytes32, bytes32)
    {
        require(sig.length == 65);

        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            // first 32 bytes, after the length prefix
            r := mload(add(sig, 32))
            // second 32 bytes
            s := mload(add(sig, 64))
            // final byte (first byte of the next 32 bytes)
            v := byte(0, mload(add(sig, 96)))
        }

        return (v, r, s);
    }

    // Builds a prefixed hash to mimic the behavior of eth_sign.
    function prefixed(bytes32 hash) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", hash));
    }

    // get owner addr
    function getOwnerAddress() public view returns (address) {
        return owner();
    }

  
    // verify whitelist 
    function verifyWhitelist(bytes32 message, bytes memory sig) public view returns (bool)
    {
        require(whitelist[message] == false, 'invalid reddem code !');
        
        address signer = recoverSigner(message, sig) ;
        return signer == owner();
    }


    /**
     * @dev Mints a token to an address with a tokenURI.
     * @param _to address of the future owner of the token
     * TODO: mintTo(address _to, unint256 amount)
     */
    function mintTo(address _to) public onlyOwner {
        // _currentId starts from 1
        uint256 currentTokenId = _currentId.current();
        require(_currentId.current() <= _maxSupply, "Mint count exceed MAX_SUPPLY!");

        _currentId.increment();
        _safeMint(_to, currentTokenId);
    }

    function _baseURI() internal view override returns (string memory) {
        return __baseURI;
    }

    function setBaseURI(string memory newBaseURI) public onlyOwner {
        __baseURI = newBaseURI;
    }

    function setMaxSupply(uint256 maxSupply) public onlyOwner {
        _maxSupply = maxSupply;
    }

    function claim(bytes32 message, bytes memory sig) public{
        require(whitelist[message] == false, 'invalid reddem code !');
        address signer = recoverSigner(message, sig);
        require(signer == owner());

        uint256 currentTokenId = _currentId.current();
        require(_currentId.current() <= _maxSupply, "Mint count exceed MAX_SUPPLY!");

        _currentId.increment();
        _safeMint(_msgSender(), currentTokenId);
        
        whitelist[message] = true;
    }
}

